p.x:
var $bm_rt;
$bm_rt = $bm_sum([
    thisComp.width / 2,
    thisComp.height / 2
], effect('Position')('ADBE Point Control-0001'));

s.x:
var $bm_rt;
var heightScale, widthScale, usedScale, scaleX, scaleY;
heightScale = $bm_div(thisComp.height, 1080);
widthScale = $bm_div(thisComp.width, 1920);
usedScale = $bm_mul(Math.max(heightScale, widthScale), 100);
scaleX = effect('Scale X')(1);
scaleY = effect('Scale Y')(1);
$bm_rt = $bm_mul([
    usedScale * scaleX / 100,
    usedScale * scaleY / 100
], $bm_div(effect('Scale')('ADBE Slider Control-0001'), 100));

tm.x:
var $bm_rt;
$bm_rt = function () {
    var sE = source.duration;
    var lmC = null;
    var smC = null;
    var acms = 'zzzzzzzzzzzzzzz_ACPrecompMarker';
    t = $bm_sub(time, inPoint);
    for (var i = 1; i <= thisLayer.marker.numKeys; i++) {
        var m = thisLayer.marker.key(i);
        try {
            if (!m.parameters.hasOwnProperty(acms)) {
                continue;
            }
        } catch (e) {
            continue;
        }
        if (m.comment == 'CUT') {
            lmC = m;
        }
    }
    for (var i = 1; i <= source.marker.numKeys; i++) {
        var m = source.marker.key(i);
        try {
            if (!m.parameters.hasOwnProperty(acms)) {
                continue;
            }
        } catch (e) {
            continue;
        }
        if (m.comment == 'CUT') {
            smC = m;
        }
    }
    if (!(smC && lmC)) {
        return time;
    }
    var lmtC = $bm_sub(lmC.time, inPoint);
    var smtC = smC.time;
    if (time > outPoint) {
        return sE;
    } else if (t <= lmtC) {
        return lmtC ? t * (smtC / lmtC) : smtC;
    }
    return $bm_sum(smtC, $bm_mul($bm_sub(t, lmtC), $bm_div($bm_sub(sE, smtC), $bm_sub($bm_sub(outPoint, inPoint), lmtC))));
}();

